import React from 'react';
import Navbar from '../components/Navbar/Navbar.js';
import { styled } from 'styled-components';

const Home = () => {
  return (
    <>
      <Navbar>
        <div>Home</div>;
      </Navbar>
    </>
  );
};

export default Home;
